using System.Text;
using System.Data;

namespace AspDotNetStorefrontCore
{
    public class ftsddl
    {

        public ftsddl()
        {
        }

        public string query1
        {
            get
            {
                return "EXEC [dbo].[sp_fulltext_database] @action = 'enable' ";
            }
        }

        public string query1_uninstall
        {
            get
            {
                return "EXEC [dbo].[sp_fulltext_database] @action = 'disable' ";
            }
        }

        public string query2
        {
            get
            {
                return "CREATE FULLTEXT CATALOG ";
            }
        }

        public string query3
        {
            get
            {
                return "ALTER FULLTEXT CATALOG ";
            }
        }

        public string query4
        {
            get
            {
                return "CREATE FULLTEXT INDEX ON dbo.Product(Name,Description,SKU,SEKeywords,Summary) KEY INDEX UIX_Product_ProductGUID ON ";
            }
        }

        public string query5
        {
            get
            {
                return " WITH CHANGE_TRACKING AUTO ";
            }
        }

        public string query6
        {
            get
            {
                return "CREATE TABLE [dbo].[NoiseWords]([word] [varchar](50) NOT NULL, [ID] [int] IDENTITY(1,1) NOT NULL, CONSTRAINT [PK_NoiseWords] PRIMARY KEY CLUSTERED([word] ASC)) ";
            }
        }

        public string query6_uninstall
        {
            get
            {
                return @"if exists (select * From sysobjects where id = object_id('NoiseWords') and type = 'u')
                            DROP TABLE dbo.NoiseWords ";
            }
        }

        public string query7
        {
            get
            {
                return "CREATE FUNCTION [dbo].[GetValidSearchString] (@searchterm nvarchar(4000)) RETURNS nvarchar(4000) AS BEGIN DECLARE @s nvarchar(4000) SET @s = '' SELECT @s = @s + " + "'" + '"' + "'" + " + s.items + " + "'" + '"' + "'" + " + ' or ' FROM dbo.Split(@searchterm, ' ') s left join dbo.NoiseWords n on s.items = n.word WHERE n.word is null IF len(@s) > 3 RETURN left(@s, len(@s)-3) ELSE SET @s = 'a' RETURN @s END ";
            }
        }

        public string query7_uninstall
        {
            get
            {
                return @"IF  EXISTS (SELECT * FROM sysobjects WHERE id = OBJECT_ID(N'[dbo].[GetValidSearchString]') AND type in (N'FN', N'IF', N'TF', N'FS', N'FT'))
                            DROP FUNCTION [dbo].[GetValidSearchString]";
            }
        }

        public string query8
        {
            get
            {
                return "CREATE FUNCTION [dbo].[KeyWordSearch](@srchString nvarchar(4000)) RETURNS TABLE AS RETURN(SELECT productid FROM dbo.product WHERE FREETEXT(*, @srchString )) ";
            }
        }

        public string query8_uninstall
        {
            get
            {

                return @"IF  EXISTS (SELECT * FROM sysobjects WHERE id = OBJECT_ID(N'[dbo].[KeyWordSearch]') AND type in (N'FN', N'IF', N'TF', N'FS', N'FT'))
                        DROP FUNCTION [dbo].[KeyWordSearch] ";
            }
        }

        public string sqlCheckFTSEngine
        {
            get
            {
                return "select FULLTEXTSERVICEPROPERTY('IsFullTextInstalled')";
            }
        }

        public string sqlCheckFTSEnabled
        {
            get
            {
                return "select DATABASEPROPERTY(DB_Name(), N'IsFullTextEnabled')";
            }
        }

        public string sqlSearchFTCatalogs
        {
            get
            {
                return "select count(name) from sys.fulltext_catalogs";
            }
        }

        public string sqlAvailFTCatalogs
        {
            get
            {
                return "select Name from sys.fulltext_catalogs";
            }
        }

        public string sqlCheckFTIndex
        {
            get
            {
                return "select count(*) from sys.fulltext_indexes A left join sys.indexes B on A.object_id = B.object_id where B.name = 'UIX_Product_ProductGUID'";
            }
        }

        public string sqlDropFTIndex
        {
            get
            {
                return "DROP FULLTEXT INDEX ON dbo.Product";
            }
        }

        public string sqlGetFTCatalogName
        {
            get
            {
                return "select C.name from sys.fulltext_indexes A left join sys.indexes B on A.object_id = B.object_id left join sys.fulltext_catalogs C on A.fulltext_catalog_id = C.fulltext_catalog_id where B.name = 'UIX_Product_ProductGUID'";
            }
        }



